import React from "react";
import Item from "./Item";
import dashboardIcon from "../../icons/dashboard.png";  // Обычная иконка
import dashboardIconHover from "../../icons/dashboard_blue.png";  // Иконка для наведения
import ControlPanelIcon from "../../icons/control_panel.png";
import ControlPanelIconHover from "../../icons/control_panel_hover.png";
import PnlIcon from "../../icons/pnl.png";
import PnlIconHover from "../../icons/pnl_hover.png";
import HistoryIcon from "../../icons/history.png";
import HistoryIconHover from "../../icons/history_hover.png";
import SecurityIcon from "../../icons/security_gray.png";
import SecurityIconHover from "../../icons/security_hover.png";

const MainMenu = () => {
  return (
    <div>
      <Item
        text="Dashboard"
        defaultIcon={dashboardIcon}
        hoverIcon={dashboardIconHover}
        onClick={() => alert("Dashboard clicked!")}
        className="dashboard-button"
      />
      <Item
        text="Control Panel"
        defaultIcon={ControlPanelIcon}
        hoverIcon={ControlPanelIconHover}
        onClick={() => alert("Control Panel clicked!")}
        className="control-panel-button"
      />
      <Item
        text="PNL"
        defaultIcon={PnlIcon}
        hoverIcon={PnlIconHover}
        onClick={() => alert("PNL clicked!")}
        className="pnl-button"
      />
      <Item
        text="History"
        defaultIcon={HistoryIcon}
        hoverIcon={HistoryIconHover}
        onClick={() => alert("History clicked!")}
        className="history-button"
      />
      <Item
        text="Security"
        defaultIcon={SecurityIcon}
        hoverIcon={SecurityIconHover}
        onClick={() => alert("Security clicked!")}
        className="security-button"
      />
    </div>
  );
};

export default MainMenu;
